stdx.format.assertCTFEable!(function () pure @safe
{
assert(__equals(format("foo"), "foo"));
assert(__equals(format("foo%%"), "foo%"));
assert(__equals(format("foo%s", 'C'), "fooC"));
assert(__equals(format("%s foo", "bar"), "bar foo"));
assert(__equals(format("%s foo %s", "bar", "abc"), "bar foo abc"));
assert(__equals(format("foo %d", -123), "foo -123"));
assert(__equals(format("foo %d", 123), "foo 123"));
assertThrown(delegate string() pure @nogc @safe => format("foo %s"), null, "source/stdx/format/package.d", 818LU);
assertThrown(delegate string() pure @nogc @safe => format("foo %s", 123, 456), null, "source/stdx/format/package.d", 819LU);
assert(__equals(format("hel%slo%s%s%s", "world", -138, 'c', true), "helworldlo-138ctrue"));
}
).assertCTFEable

stdx.format.assertCTFEable!(function () pure @safe
{
string tmp = format("%,d", 1000);
assert(__equals(tmp, "1,000"), "'" ~ tmp ~ "'");
tmp = format("%,?d", 'z', 1234567);
assert(__equals(tmp, "1z234z567"), "'" ~ tmp ~ "'");
tmp = format("%10,?d", 'z', 1234567);
assert(__equals(tmp, " 1z234z567"), "'" ~ tmp ~ "'");
tmp = format("%11,2?d", 'z', 1234567);
assert(__equals(tmp, " 1z23z45z67"), "'" ~ tmp ~ "'");
tmp = format("%11,*?d", 2, 'z', 1234567);
assert(__equals(tmp, " 1z23z45z67"), "'" ~ tmp ~ "'");
tmp = format("%11,*d", 2, 1234567);
assert(__equals(tmp, " 1,23,45,67"), "'" ~ tmp ~ "'");
tmp = format("%11,2d", 1234567);
assert(__equals(tmp, " 1,23,45,67"), "'" ~ tmp ~ "'");
}
).assertCTFEable

